INSERT INTO `profil` (`id_profil`, `konten`, `desa`) VALUES
(16, '                                                                                                                        <p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; text-indent: 36pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Desa Ombulo adalah salah dari sepuluh desa yang berada di wilayah Kecamatan Limboto\r\nBarat. Desa ombulo dibuka pada tahun 1805 waktu pada zaman jajahan Belanda\r\nbapak Kengo dengan gelar adat&nbsp;<i>Ti Bonga</i>, </span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">sebagai Kepala desa.\r\nDulunya </span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">desa ombulo masih\r\nhutan belantara yang terdapat di belahan barat kecamatan limboto (limutu).</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; text-indent: 36pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Adapun\r\nDesa Ombulo menurut riwayat dari orang tua dulu, bahwa desa ombulo bukannya\r\ndesa tersebut ada tumbuhan daun woka (ombulo), </span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">namun,</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"> itu merupakan ciri khas yang tertentu antara lain:</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">a.&nbsp;Ombulo\r\n(woka) adalah salah satu tumbuhan dalam hutan yang batangnya berdiri tegak\r\nlurus, yang melambangkan kejujuran serta ketulusan hati.</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">b.&nbsp;Ombulo\r\n(woka) daunnya lebat dan menyerupai yang melambangkan pemerintah harus dapat\r\nmengayomi dan melindungi masyarakat dari berbagai masalah yang datang dari\r\nluar.</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">c.&nbsp;Ombulo\r\n(woka) adalah suatu bahan yang berguna bagi kebutuhan masyarakat, melambangkan\r\nagar masyarakat harus memberikan yang terbaik terhadap orang lain maupun kepada\r\npemerintah.</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">d.&nbsp;Ombulo\r\n(woka) adalah salah satu daun yang mudah robek/hancur apabila si pengguna daun\r\nitu terlalu kasar memakainya, ini melambangkan ataupun mengingatkan kepada\r\npemerintah desa dalam hal ini Kepala Desa jangan terlalu kasar dalam\r\nmenjalankan tugas tetapi harus dilaksanakan dengan secara lemah lembut,\r\nsehingga masyarakat tidak menjadi terpisah-pisah maupun berkotak-kotak bagaikan\r\ndaun ombulo (woka).</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">GEOGRAFI</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; text-indent: 36pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Desa\r\nombulo pada waktu itu memiliki luas tanah&nbsp;<u>+</u>&nbsp;5000 ha dan sekarang\r\ntinggal 1000 ha, yang disebabkan oleh:</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Pada tahun\r\n1820 sebagian menjadi desa Daenaa</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Pada tahun\r\n1904 sebagian menjadi desa Yosonegoro</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Pada tahun\r\n1930 sebagian menjadi desa Padengo</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Pada tahun\r\n1952 sebagian menjadi desa Huidu</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; text-indent: 36pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Batas-batasnya:</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Sebelah\r\nutara berbatasan dengan Desa Daenaa</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Sebelah\r\nselatan berbatasan dengan desa Tunggulo</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Sebelah\r\ntimur berbatasan dengan desa Pone</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify; text-indent: -18pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">·&nbsp;Sebelah\r\nBarat berbatasan dengan Isimu</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:18.0pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Adapun yang pertama kali\r\nmerintis/membuka tanah tersebut yakni salah seorang laki-laki yang berasal dari\r\nBolihuangga Kecamatan Limboto yang bernama Biku kemudian menghilang sehingga\r\nmenjelma menjadi iblis yang disebut oleh orang tua&nbsp;<em>Dulu Polohuta Tau</em>&nbsp;dan\r\nsekarang mendapat julukan&nbsp;<em>Tibulonga Daa</em>&nbsp;dan sampai sekarang\r\nrohnya apabila dipanggil akan muncul untuk mengobati orang sakit dan\r\ntanda-tandanya dia datang ke tempat itu&nbsp;<em>berbau</em>&nbsp;(aroma)&nbsp;<em>pece/tambo</em>&nbsp;(becek).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:18.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Desa ombulo terdapat beberapa Lembaga-lembaga adat yang menaungi desa\r\nseprti pemangku Adat dan Kepengurusan adat. Selain itu, terdapat simbol-simbol\r\nadat yakni Rumah Adat, Barang Pustaka, dan naskah-naskah yang masih mereka jaga\r\nsampai dengan sekarang. Tak hanya &nbsp;Ombulo\r\njuga mempunyai kelompok Dasawisma yang membantu apparat desa untuk melakukan\r\naktivitas bermanfaat bagi keluarga di Desa. Desa Ombulo juga sudah mempunyai\r\nBUMDES yang di Kelola oleh pemerintah Desa yang menjadi aset dari desa\r\ntersebut. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:18.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Tentunya, Kemajuan Desa Ombulo bisa seperti ini berkat pemimpin-pemimpin\r\nyang hebat. Berikut nama-nama kepala Desa yang menjabat:<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: -18pt; line-height: 150%; margin-left: 25px;\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Kengo 1805-1829<b><o:p></o:p></b></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -18pt; line-height: 150%; margin-left: 25px;\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Otuhu 1929-1833<b><o:p></o:p></b></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -18pt; line-height: 150%; margin-left: 25px;\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Limbawu 1833-1839<b><o:p></o:p></b></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -18pt; line-height: 150%; margin-left: 25px;\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Bangiyo 1840-1849<b><o:p></o:p></b></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -18pt; line-height: 150%; margin-left: 25px;\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: 