INSERT INTO `profil` (`id_profil`, `konten`, `desa`) VALUES
(17, '                                                                        <p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.45pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Menurut\r\nsejarah dan legenda yang disampaikan sesepuh dan tetua yang ada di desa\r\nYosonegoro, bahwa desa Yosonegoro pada awal</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">nya</span><span lang=\"IN\" style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,serif\"> bernama desa Yosonegoro</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> </span><span lang=\"IN\" style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,serif\">yang artinya membangun\r\nnegeri atau desa.</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Awal&nbsp; mula <b>Mbah\r\nAmal Kyai Modjo</b> selesai Sekolah Guru (Kweek School) Tahun 1895 di Ambon,\r\nbeliau di tugaskan sebagai Guru&nbsp; di\r\ndaerah&nbsp; Kwandang .</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> </span><b><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Mbah\r\nAmal Kyai Modjo</span></b><span lang=\"IN\" style=\"font-size:12.0pt;line-height:\r\n150%;font-family:&quot;Times New Roman&quot;,serif\"> adalah cucu pertama dari <b>Mbah Kyai Gazali Modjo,</b> sedangkan <b>Mbah Kyai Gazali Modjo</b> adalah anak\r\npertama dari <b>Mbah Guru Kyai Modjo</b> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">yang nama </span><span lang=\"IN\" style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,serif\">sebenarnya&nbsp; adalah&nbsp;\r\n<b>Kyai&nbsp; Muslim&nbsp;\r\nMuhammad&nbsp; Khalifah </b>. </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">&nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%;tab-stops:42.55pt 49.65pt 78.0pt\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desa Yosonegoro merupakan salah\r\nsatu dari 10 desa yang ada di Kecamatan Limboto Barat Kabupaten Gorontalo.\r\nDilihat dari letak Geografisnya Desa Yosonegoro berada pada ketinggian 2000\r\nMeter sampai 4000 Meter dari permukaan laut.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.45pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\"> Awal mula desa Yosonegoro dalam pemerintahan\r\ndesa dipimpin oleh kepala desa dari tahun 1904 sampai dengan 1978, tahun 1979\r\nsampai dengan tahun 2003 desa Yosonegoro dipimpin oleh Lurah (menjadi kelurahan).\r\nPada tahun 2003 kecamatan Limboto Barat berpisah dari kecamatan Limboto maka\r\nsemua kelurahan yang ada dikecamatan menjadi desa sampai dengan sekarang.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jarak tempuh dari desa ke Kecamatan\r\nadalah kurang lebih 1,5 Kilo Meter ke arah Timur, sedangkan jarak tempuh dari\r\npusat desa ke kota Kabupaten lebih 7 Kilo Meter ke arah timur. Kalau dari pusat\r\ndesa Provinsi dapat dilalui melalui satu jurusan yaitu : lewat kota Kabupaten\r\nberjarak&nbsp; 23 Kilo Meter.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%;tab-stops:42.55pt 49.65pt 78.0pt\"><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Luas wilayah desa Yosonegoro\r\nadalah 500 Ha yang peruntukkannya adalah sebagai berikut : lahan pekarangan /\r\npemukiman, lahan pertanian, pemerintahan dan umum. Tanaman, baik tanaman\r\nbuah-buahan maupun jenis komoditi lainnya. Desa Yosonegoro berbatasan dengan\r\nbeberapa desa/kelurahan yaitu :<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:92.15pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo1;\r\ntab-stops:42.55pt 49.65pt 78.0pt\"><!--[if !supportLists]--><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">a.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"IN\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Utara\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : berbatasan dengan Desa Ombulo<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:92.15pt;mso-add-space:\r\nauto;text-align:justify;text-ind